import TopTitle from "../dom/Header";
import NewTitle from "../forms/NewTitle";
import Footer from "../dom/Footer";

const NewTitlePage = () => {

  return (
    <>
      <TopTitle />
      <NewTitle />
      <Footer />
    </>
  );
};

export default NewTitlePage;
